<script>
    function changecheck(id){
        var t = document.getElementById(id).checked;
        if(t){
            $(""#Q"" + id).prop( ""disabled"", false );
        }
        else{
            $(""#Q"" + id).prop( ""disabled"", true );
        }
        
    }
    function TimKiem(){
        var type = $(""#select"").val();
